export default {
  name: "headnav",
  mounted(){
    //初次加载不在首页时校准导航状态
    this.initNav();
  },
  methods:{
    initNav(){
      var name = this.$route.name;
      this.$store.commit('set_navname',name);
    },
    changelink: function(name){
      this.$store.commit('set_navname',name);
      this.$router.push({name:name})
    }
  }

};
